import Vue from 'vue';
import { AgGridVue } from '@ag-grid-community/vue';
import '@ag-grid-community/styles/ag-grid.css';
import "@ag-grid-community/styles/ag-theme-quartz.css";
import './styles.css';
import { createDataItem, getData } from './data.js';
import { ClientSideRowModelModule } from '@ag-grid-community/client-side-row-model';
import { RowGroupingModule } from '@ag-grid-enterprise/row-grouping';
import { ModuleRegistry } from "@ag-grid-community/core";
ModuleRegistry.registerModules([ClientSideRowModelModule, RowGroupingModule]);





const VueExample = {
    template: `
        <div style="height: 100%">
                <div class="test-container">
      <div class="test-header">
        <button v-on:click="onBtUpdate()">Update</button>
        <button v-on:click="onBtDuplicate()">Duplicate</button>
        <button v-on:click="onBtDelete()">Delete</button>
        <button v-on:click="onBtClearSelection()">Clear Selection</button>
      </div>
      <ag-grid-vue
        style="width: 100%; height: 100%;"
        :class="themeClass"
        :columnDefs="columnDefs"
        @grid-ready="onGridReady"
        :getRowId="getRowId"
        :defaultColDef="defaultColDef"
        :rowSelection="rowSelection"
        :groupSelectsChildren="true"
        :suppressRowClickSelection="true"
        :autoGroupColumnDef="autoGroupColumnDef"
        :isGroupOpenByDefault="isGroupOpenByDefault"></ag-grid-vue>
      </div>
        </div>
    `,
    components: {
        'ag-grid-vue': AgGridVue,

    },
    data: function() {
        return {
            columnDefs: [{field:"city",
rowGroup:true,
hide:true},{field:"laptop",
rowGroup:true,
hide:true},{field:"distro",
sort:"asc",
comparator:myComparator},{field:"value",
enableCellChangeFlash:true,
aggFunc:myAggFunc,
filter:myFilter}],
            gridApi: null,
            themeClass: /** DARK MODE START **/document.documentElement.dataset.defaultTheme || 'ag-theme-quartz'/** DARK MODE END **/,
            defaultColDef: {
    flex: 1,
    filter: true,
},
            rowSelection: null,
autoGroupColumnDef: null
        }
    },
    created() {
        this.rowSelection = 'multiple';
this.autoGroupColumnDef = {
    field: 'name',
    cellRendererParams: { checkbox: true },
}        
    },
    methods: {
        onBtDuplicate() {
    // get the first child of the
    var selectedRows = this.gridApi.getSelectedRows();
    if (!selectedRows || selectedRows.length === 0) {
        console.log('No rows selected!');
        return;
    }
    var newItems = [];
    selectedRows.forEach((selectedRow) => {
        var newItem = createDataItem(selectedRow.name, selectedRow.distro, selectedRow.laptop, selectedRow.city, selectedRow.value);
        newItems.push(newItem);
    });
    timeOperation('Duplicate', () => {
        this.gridApi.applyTransaction({ add: newItems });
    });
},
onBtUpdate() {
    // get the first child of the
    var selectedRows = this.gridApi.getSelectedRows();
    if (!selectedRows || selectedRows.length === 0) {
        console.log('No rows selected!');
        return;
    }
    var updatedItems = [];
    selectedRows.forEach((oldItem) => {
        var newValue = Math.floor(Math.random() * 100) + 10;
        var newItem = createDataItem(oldItem.name, oldItem.distro, oldItem.laptop, oldItem.city, newValue, oldItem.id);
        updatedItems.push(newItem);
    });
    timeOperation('Update', () => {
        this.gridApi.applyTransaction({ update: updatedItems });
    });
},
onBtDelete() {
    // get the first child of the
    var selectedRows = this.gridApi.getSelectedRows();
    if (!selectedRows || selectedRows.length === 0) {
        console.log('No rows selected!');
        return;
    }
    timeOperation('Delete', () => {
        this.gridApi.applyTransaction({ remove: selectedRows });
    });
},
onBtClearSelection() {
    this.gridApi.deselectAll();
},
onGridReady(params) {

        this.gridApi = params.api;



    params.api.setFilterModel({
        value: { value: '50' },
    });
    timeOperation('Initialisation', () => {
        params.api.setGridOption('rowData', getData());
    });

    },
getRowId(params) {
    return params.data.id;
},
isGroupOpenByDefault(params) {
    return ['Delhi', 'Seoul'].includes(params.key);
},
    }
}

window.myAggFunc = function myAggFunc(params) {
    aggCallCount++;
    var total = 0;
    for (var i = 0; i < params.values.length; i++) {
        total += params.values[i];
    }
    return total;
}

window.myComparator = function myComparator(a, b) {
    compareCallCount++;
    return a < b ? -1 : 1;
}

window.getMyFilter = function getMyFilter() {
    class MyFilter {
        init(params) {
            this.filterParams = params;
            this.filterValue = null;
            this.eGui = document.createElement('div');
            this.eGui.innerHTML = '<div>Greater Than: <input type="text"/></div>';
            this.eInput = this.eGui.querySelector('input');
            this.eInput.addEventListener('input', () => {
                this.getValueFromInput();
                params.filterChangedCallback();
            });
        }
        getGui() {
            return this.eGui;
        }
        getValueFromInput() {
            var value = parseInt(this.eInput.value);
            this.filterValue = isNaN(value) ? null : value;
        }
        setModel(model) {
            this.eInput.value = model == null ? null : model.value;
            this.getValueFromInput();
        }
        getModel() {
            if (!this.isFilterActive()) {
                return null;
            }
            return { value: this.eInput.value };
        }
        isFilterActive() {
            return this.filterValue !== null;
        }
        doesFilterPass(params) {
            filterCallCount++;
            const { node } = params;
            const value = this.filterParams.getValue(node);
            return value > (this.filterValue || 0);
        }
    }
    return MyFilter;
}

window.timeOperation = function timeOperation(name, operation) {
    aggCallCount = 0;
    compareCallCount = 0;
    filterCallCount = 0;
    var start = new Date().getTime();
    operation();
    var end = new Date().getTime();
    console.log(name +
        ' finished in ' +
        (end - start) +
        'ms, aggCallCount = ' +
        aggCallCount +
        ', compareCallCount = ' +
        compareCallCount +
        ', filterCallCount = ' +
        filterCallCount);
}

var aggCallCount = 0;

var compareCallCount = 0;

var filterCallCount = 0;

var myFilter = getMyFilter();

new Vue({
    el: '#app',
    components: {
        'my-component': VueExample
    }
});

